         dispatch(fetchAuthMe());
     });
  return (
    <>
      <Header />
      <Container maxWidth="lg">
          <Routes>
              <Route path = "/" element={<Home/>} />
              <Route path = "/medicalnote/:id" element={<FullPost/>} />
              <Route path = "/add-medicalnote" element={<AddPost/>} />
              <Route path = "/login" element={<Login/>} />
              <Route path = "/register" element={<Registration/>} />
          </Routes>
      </Container>
    </>
  );
}

export default App;
